import React from 'react';

function About() {
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>About Motorbike Explorer</h1>

      <p style={styles.paragraph}>
        Motorbike Explorer is your go-to platform for discovering the best motorcycles across premium and popular brands. Whether you're a biking enthusiast, a researcher, or someone planning to buy a bike, our site brings all the information you need in one place.
      </p>

      <h2 style={styles.subheading}>üîç Key Features</h2>
      <ul style={styles.list}>
        <li>üåê Search bikes by brand instantly</li>
        <li>üìä View specifications like engine, power, torque, and top speed</li>
        <li>üèÜ Explore top picks from major motorcycle companies</li>
        <li>üìÖ Discover historical and popular models with fast facts</li>
        <li>üîó Direct links to Wikipedia for detailed bike information</li>
      </ul>

      <h2 style={styles.subheading}>üõ† Technologies Used</h2>
      <ul style={styles.list}>
        <li>‚öõÔ∏è React JS for building interactive UI</li>
        <li>üì° API Ninjas Motorcycles API for real-time bike data</li>
        <li>üé® Custom CSS for a sleek, responsive layout</li>
        <li>üåç React Router for seamless navigation</li>
      </ul>

      <h2 style={styles.subheading}>üéØ Purpose of This Project</h2>
      <p style={styles.paragraph}>
        This project was built to demonstrate API integration and frontend skills using React. It also serves as a practical tool for users interested in exploring and comparing motorcycle models in an easy and visually appealing way.
      </p>

      <h2 style={styles.subheading}>üì© Feedback</h2>
      <p style={styles.paragraph}>
        We are always looking to improve. If you have any feedback, feel free to reach out through the contact page or suggest new features!
      </p>

      <p style={{ ...styles.paragraph, marginTop: '40px', fontWeight: 'bold' }}>
        üèçÔ∏è Keep exploring. Ride safe. Ride smart. ‚Äî Team Motorbike Explorer
      </p>
    </div>
  );
}

const styles = {
  container: {
    padding: '40px',
    maxWidth: '900px',
    margin: '0 auto',
    textAlign: 'left',
  },
  heading: {
    fontSize: '36px',
    marginBottom: '20px',
    textAlign: 'center',
  },
  subheading: {
    fontSize: '24px',
    marginTop: '30px',
    marginBottom: '10px',
  },
  paragraph: {
    fontSize: '18px',
    lineHeight: '1.6',
    marginBottom: '15px',
  },
  list: {
    fontSize: '18px',
    lineHeight: '1.8',
    paddingLeft: '20px',
  },
};

export default About;
